<template>
  <div>
    <!-- <h2>Hello World!</h2> -->
    <embed width="100%" height="100%" name="plugin" :src="pdfsrc" />
  </div>
</template>

<script>

export default {
  data() {
    return {
      pdfsrc: 'data:application/pdf;base64,'
    }
  },
  methods: {
    getPDFPath () {
        let data = 'data:application/pdf;base64,'
        const blob = new Blob([data]);
        const objectUrl = URL.createObjectURL(blob);
        this.pdfsrc = objectUrl;
      }
    },
    created() {
        this.getPDFPath();
    }
}
</script>

